import React from "react";

const Counter = () => {
	let isLogedIn = false;
	if (isLogedIn) {
		return (
			<div>
				<h2>Welcome Back</h2>
			</div>
		);
	} else {
		return (
			<div className="d-flex flex-column">
				<input type="email" placeholder="enter your email" />
				<input type="password" placeholder="enter your password" />
			</div>
		);
	}
};

export default Counter;
